import React from 'react';
import './App.css';
import { BrowserRouter } from 'react-router-dom';

import Header from './components/Header.js';
import Navbar from './components/layout/Navbar.js';

import Navigation from './components/Navigation.js';

function App() {


  return (
    <div className="App">
    <BrowserRouter>
      <Header />
      <Navbar />
      <Navigation />
    </BrowserRouter>

    </div>
  );
}

export default App;
